import React from 'react';
import { Popover, Typography } from '@mui/material';

const Password = ({ anchorEl, handleClose, open, id }) => {
  return (
    <Popover
      id={id}
      open={open}
      anchorEl={anchorEl}
      onClose={handleClose}
      anchorOrigin={{
        vertical: 'center',
        horizontal: 'left',
      }}
    //   transformOrigin={{
    //     vertical: 'center',
    //     horizontal: 'right',
    //   }}
    >
      <div style={{ width: '100vw', height: '89.5vh' }}>Hello world</div>
    </Popover>
  );
};

export default Password;
